                    </div>
                    
                    <div className="col-lg-10 p-0 title content"><br></br>
                        <div className="">
                                <h1><center>ยอดชำระรายเดือน</center></h1><br></br>
                        </div>
                          
                        
                    </div>
                </div>
            </div>
        </>
    )
}
